import React from 'react';
import { Link } from 'react-router-dom'; // If using React Router for navigation

const Login = () => {
  return (
    <div style={{ fontFamily: 'Montserrat, sans-serif' }}>

      {/* Navigation Header */}
      <nav style={{ backgroundColor: '#\#00B36B', height:'50px', padding: '10px 20px', display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
        <h1 style={{ margin: 0, color: '#fff' }}>FreshFarms</h1>
        <div>
          <Link to="/login" style={{ color: '#fff', marginRight: '20px', textDecoration: 'none', transition: 'color 0.3s ease' }} 
            onMouseEnter={(e) => e.target.style.color = 'black'}
            onMouseLeave={(e) => e.target.style.color = '#fff'}
          >
            Login
          </Link>
          <Link to="/signup" style={{ color: '#fff', marginRight: '20px', textDecoration: 'none', transition: 'color 0.3s ease' }} 
            onMouseEnter={(e) => e.target.style.color = 'black'}
            onMouseLeave={(e) => e.target.style.color = '#fff'}
          >
            Signup
          </Link>
        </div>
      </nav>

      {/* Main Login Content */}
      <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh', backgroundColor: '#ffffff' }}>
        <div style={{ display: 'flex', border: '2px solid #fff', borderRadius: '10px', backgroundColor: '#ffffff', overflow: 'hidden', height: '500px' }}>
          <div style={{ backgroundColor: '#ffffff', flex: 2 }}>
            <img src={require('./unnamed.jpg')} alt="Farmers" style={{ width: '100%', height: '100%', borderRadius: '10px', objectFit: 'cover' }} />
          </div>
          
          <div style={{ flex: 1, padding: '20px', backgroundColor: '#fff', borderRadius: '10px' }}>
          <h2 style={{ color: '#333', fontSize: '24px', marginBottom: '20px', marginLeft:'90px'}}>Welcome Back!</h2>
            
            <form style={{ display: 'flex', flexDirection: 'column' }}>
              
              <div style={{ marginBottom: '500px', backgroundColor: 'transparent' }}>
                
                <label style={{ marginTop: '10px', color: '#333' }}>
                  <input type="text" name="username" placeholder="Username" style={{ padding: '10px', borderRadius: '20px', height: '20px', border: '1px solid #ccc', transition: 'border-color 0.3s ease' }} />
                </label>
                <label style={{ marginTop: '10px', color: '#333' }}>
                  <input type="password" name="password" placeholder="Password" style={{ padding: '10px', borderRadius: '20px', height: '20px', border: '1px solid #ccc', transition: 'border-color 0.3s ease' }} />
                </label>
                <button type="submit" style={{ padding: '10px 20px', marginTop: '30px', marginBottom: '30px',backgroundColor: '#06C265', border: 'none', height: '40px', borderRadius: '50px', cursor: 'pointer', color: '#fff', transition: 'background-color 0.3s ease', boxShadow: '0 4px 6px rgba(0, 123, 255, 0.1)' }}>Login</button>
                <div>
                  <p style={{ marginTop: '10px', textAlign: 'center' }}>Don't have an account? <a href="/signup" style={{ color: '#28a745', textDecoration: 'none' }}>Sign Up</a></p>
                  <p style={{ marginTop: '10px', textAlign: 'center' }}>Join as a Farmer <a href="/farmer_signup" style={{ color: '#28a745', textDecoration: 'none' }}>here</a></p>
                </div>
              </div>
            </form>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Login;
